import heroImg from "../../../assets/images/start-screen-img.png";
import themydaLogo from "../../../assets/images/logo/lg-logo-transparent.svg";

const Hero = () => {
  return (
    <div className="get-started__hero">
      <div className="get-started__image-wrapper">
        <img
          className="get-started__image"
          src={heroImg}
          alt="People hang out."
        />
        <div className="get-started__image-dark-layer"></div>
      </div>
      <div className="get-started__image-bg-shape"></div>
    </div>
  );
};

export default Hero;
